mbeds">learn more about embeds</a>.";s:15:"gettext_context";s:0:"";}i:795;O:8:"stdClass":6:{s:2:"id";s:4:"6660";s:6:"status";N;s:3:"ctx";s:32:"bf22cc275e0dd347a2945311d7fdecac";s:10:"translated";N;s:8:"original";s:15:"Inserting Media";s:15:"gettext_context";s:0:"";}i:796;O:8:"stdClass":6:{s:2:"id";s:4:"6661";s:6:"status";N;s:3:"ctx";s:32:"a7d363674bc0d711d6d160e3dbf13846";s:10:"translated";N;s:8:"original";s:264:"<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.";s:15:"gettext_context";s:0:"";}i:797;O:8:"stdClass":6:{s:2:"id";s:4:"6662";s:6:"status";N;s:3:"ctx";s:32:"62319763264b08b9688c6a9f025316ba";s:10:"translated";N;s:8:"original";s:204:"<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.";s:15:"gettext_context";s:0:"";}i:798;O:8:"stdClass":6:{s:2:"id";s:4:"6663";s:6:"status";N;s:3:"ctx";s:32:"f11c47af7f98788ea05b855c41902aa2";s:10:"translated";N;s:8:"original";s:162:"<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.";s:15:"gettext_context";s:0:"";}i:799;O:8:"stdClass":6:{s:2:"id";s:4:"7909";s:6:"status";N;s:3:"ctx";s:32:"729a17bb97572fc5bc51306d8258323b";s:10:"translated";N;s:8:"original";s:214:"Visit %s to create your map (Step by step: 1) Find location 2) Click the cog symbol in the lower right corner and select "Share or embed map" 3) On modal window select "Embed map" 4) Copy iframe code and paste it).";s:15:"gettext_context";s:0:"";}i:800;O:8:"stdClass":6:{s:2:"id";s:4:"8741";s:6:"status";N;s:3:"ctx";s:32:"d0347cc869a0e301384904a31ec2fd31";s:10:"translated";N;s:8:"original";s:19:"Addi